import Login from "./components/auth/Login";
import { Routes, Route } from "react-router-dom";
import Register from "./components/auth/Register";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Login />} />
      <Route path="/" element={<Register />} />
    </Routes>
  );
}

export default App;
